  input: TEXT,F3XA,,"This amendment is in response to a letter from Andrea Needles
    dated March 23, 2005.  Ms. Needles indicated that John Jessen had exceeded his
    contribution limit for the calendar year of 2004; however, she and Ed Ryan (our
    FEC analyst) now acknowledge that the warning letter was sent to us in error.  CropLife
    Political Action Committee accurately disclosed a reimbursement to Mr. Jessen
    when we originally filed this 2004 year-end report.  We received his contribution
    of $3,650 on November 29 and reimbursed him for the full amount on December 2.  This
    was reported on Line 28(a) of the year-end report.  We have been asked by Ms.
    Needles and Mr. Ryan to file an amendment so as to create a record of us responding
    to the warning letter, but please be aware that no data has been changed in this
    report.  The only alteration is this memo text.  Thank you."
